import React from 'react';
import './../App.css';
import { Link } from 'react-router-dom';

function Nav() {

    return (
            <ul>
                 <li> <Link to="/">HOME</Link></li>
                <Link to="/members">
                    <li>Members</li>
                </Link>
                <Link to="/new">
                    <li>New</li>
                </Link>
                <Link to="/about">
                    <li>About</li>
                </Link>
            </ul>
    )
}

export default Nav;
